    [],nt"revision_timestamp": "2016-07-27T23:01:53.371061",nt"name": "burning-and-browsing-effects-on-willow-growth-in-interior-alaska",nt"isopen":
    false,nt"url": null,nt"notes": "The dominant species in mature forests
    of interior Alaska is either white spruce (Picea glauca} or black spruce (P. mariana),
    with wood shrubs present at lower densities. The biomass of forage available to
    moose at various successional stages has not been determined for this region of
    interior Alaska, though it has been done elsewhere. I compared current annual growth
    of browsed and unbrowsed Scouer willow on a burn and on an adjacent mature black
    spruce forest. The role of fire in improving winter moose habitat through increased
    production of woody browse was also examined. Data were collected in 1974 and 1975.",nt"license_title":
